import Navbar from "./components/Navbar";
import Searchbox from "./components/Searchbox";
import Products from "./components/Products"
import About from "./components/About";
import Footer from './components/Footer';

function App()
{
    <div>
      <Navbar></Navbar>
      <Searchbox></Searchbox>
      <Products></Products>
      <About></About>
      <Footer></Footer>
    </div>
}

export default App
